var mySwiper=new Swiper(".swiper-container",{navigation:{nextEl:".swiper-button-next",prevEl:".swiper-button-prev"}});const divPricePlan=document.querySelector(".price__plan"),priceBusiness=document.getElementById("business-class"),priceMaster=document.getElementById("pro-master"),plan={monthly:{business:29,master:99},annually:{business:19,master:89}};function selectionPlan(e=plan.monthly,t=!1){priceBusiness.innerHTML="$"+e.business,priceMaster.innerHTML="$"+e.master,t?divPricePlan.classList.add(t):divPricePlan.classList=divPricePlan.classList.item(0)}selectionPlan(),divPricePlan.addEventListener("click",e=>{"DIV"!==e.target.tagName&&("annually"===e.target.id?selectionPlan(plan[e.target.id],e.target.id):selectionPlan())});const faq=document.querySelector(".faq__list"),faqItems=document.querySelectorAll(".faq__item");faq.addEventListener("click",e=>{"H3"===e.target.tagName&&faqItems.forEach(t=>{t===e.target.closest(".faq__item")?t.classList.add("show"):t.classList.remove("show")})});